postcontent:
Benelli 12 gauge, used. Lost the box while moving a couple years ago. Bought new at Gander Mountain (Yes i know i paid more than i should have@ GM), used a couple of times but with the number of "toys" i own currently this shot gun has not seen much action. Only selling because i bought a supernova and feel that suits me better. I'm not looking to get rich so I'm pricing it at $250 Cash.
Low baller's or disrespectful offers will be ignored. There's room for negotiation but not much. I could just keep it and give it to my son to add to his collection.
if you do not plan on buying it please do not bother me with questions. (not my first sale on ArmsList)
